import axios from 'axios';
import { ENDPOINTS } from '../config/api';

const api = {
  sendChatMessage: (message) => axios.post(ENDPOINTS.CHAT, { message }),
  getAppointments: () => axios.get(ENDPOINTS.APPOINTMENTS),
  createAppointment: (appointmentData) => axios.post(ENDPOINTS.APPOINTMENTS, appointmentData),
  getVitals: () => axios.get(ENDPOINTS.VITALS),
  addVital: (vitalData) => axios.post(ENDPOINTS.VITALS, vitalData),
};

export default api;
